    public Dropdown DropdownPlatform, DropdownCpu, DropdownGpu, DropdownRam, DropdownOs;
    public Text TextBox;
    public UdonSharpBehaviour DataReceiveUdon;
    public Button SendButton;
    public Text TextBox_Error;
    public Button UpdateButton;
    public GameObject SW0, SW1, SW2;

    private int Platform, Cpu, Gpu, Ram, Os;

    public UdonSharpBehaviour BlockMultipleAnswersUdon;



    void Start()
    {
        TextBox.text = "Debug Log:\n";
        SendCustomEventDelayedSeconds(nameof(PushUpdateButton), 2.0f);
    }

    public override void OnStringLoadSuccess(IVRCStringDownload result)
    {
        TextBox.text += $"{result.Result}\n";
    }
    public override void OnStringLoadError(IVRCStringDownload result)
    {
        TextBox.text += "Error!!!\n";
    }

    public void PushButton()
    {
        Platform = DropdownPlatform.value - 1;
        Cpu = DropdownCpu.value - 1;
        Gpu = DropdownGpu.value - 1;
        Ram = DropdownRam.value - 1;
        Os = DropdownOs.value - 1;

        if (-1 != Platform && -1 != Cpu && -1 != Gpu && -1 != Ram && -1 != Os)
        {
            TextBox.text += $"InputData : {Platform}, {Cpu}, {Gpu}, {Ram}, {Os}\n";
            TextBox_Error.text = "";
            SendButton.interactable = false;
            UpdateButton.interactable = false;
            SW0.SetActive(false); SW1.SetActive(false); SW2.SetActive(false);
            SendCpu();
        }
        else
        {
            TextBox_Error.text = "選択されていない項目があります\nSome items are not selected.";
        }
    }

    public void SendCpu()
    {
        if (0 == Platform){VRCStringDownloader.LoadUrl(Url_Cpu_Pcvr[Cpu], (IUdonEventReceiver)this);}
        else              {VRCStringDownloader.LoadUrl(Url_Cpu_Desktop[Cpu], (IUdonEventReceiver)this);}
        TextBox.text += "Send Cpu Data : ";
        SendCustomEventDelayedSeconds(nameof(SendGpu), 5.0f);
    }
    public void SendGpu()
    {
        if (0 == Platform){VRCStringDownloader.LoadUrl(Url_Gpu_Pcvr[Gpu], (IUdonEventReceiver)this);}
        else              {VRCStringDownloader.LoadUrl(Url_Gpu_Desktop[Gpu], (IUdonEventReceiver)this);}
        TextBox.text += "Send Gpu Data : ";
        SendCustomEventDelayedSeconds(nameof(SendRam), 5.0f);
    }
    public void SendRam()
    {
        if (0 == Platform){VRCStringDownloader.LoadUrl(Url_Ram_Pcvr[Ram], (IUdonEventReceiver)this);}
        else              {VRCStringDownloader.LoadUrl(Url_Ram_Desktop[Ram], (IUdonEventReceiver)this);}
        TextBox.text += "Send Ram Data : ";
        SendCustomEventDelayedSeconds(nameof(SendOs), 5.0f);
    }
    public void SendOs()
    {
        if (0 == Platform){VRCStringDownloader.LoadUrl(Url_Os_Pcvr[Os], (IUdonEventReceiver)this);}
        else              {VRCStringDownloader.LoadUrl(Url_Os_Desktop[Os], (IUdonEventReceiver)this);}
        TextBox.text += "Send Os Data : ";
        SendCustomEventDelayedSeconds(nameof(ResultUpdate), 5.0f);
    }
    public void ResultUpdate()
    {
        TextBox.text += "All data has been sent!\n\n";
        DataReceiveUdon.SendCustomEvent("ReceiveData");
        SendCustomEventDelayedSeconds(nameof(AllDone), 5.0f);
    }
    public void AllDone()
    {
        UpdateButton.interactable = true;
        SW0.SetActive(true); SW1.SetActive(true); SW2.SetActive(true);

        // Rejoinしてもボタンを押せなくする
        BlockMultipleAnswers userData = BlockMultipleAnswers.GetInstance(Networking.LocalPlayer);
        userData.Answered();
    }

    public void PushUpdateButton()
    {
        UpdateButton.interactable = false;
        SW0.SetActive(false); SW1.SetActive(false); SW2.SetActive(false);
        DataReceiveUdon.SendCustomEvent("ReceiveData");
        SendCustomEventDelayedSeconds(nameof(EnableUpdateButton), 5.0f);
    }
    public void EnableUpdateButton()
    {
        UpdateButton.interactable = true;
        SW0.SetActive(true); SW1.SetActive(true); SW2.SetActive(true);
    }

}
